VALUES ('3292590831844', 'Mélange de légumes grillés', '@GEMENGDE GEGRILDE GROENTEN - GEMENGDE GEGRILDE GROENTEN (COURGETTES, AUBERGINES, RODE EN GELE PAPRIKA), DIEPGEVROREN. INGREDIËNTEN: gegrildo courgottos 35%, gegrilde aubergines 35%, gegrilde rode en gele paprika 30%. Herkomst Italië. BEWARING: • 24 uurin de koelkast • 3 dagen in het vriesvak van de koelkast • Tot aan de op de verpakking vermelda houdbaarheidsdatum in een diepvriezer bij-180C. BEWAREN BIJ -FC. NA ONTDOOIING NIET OPNIEUW INVRIZEN, GEMIDDELDE ENERGETISCHE EN NUTRITIONELE WAARDEN VOOR IOOg: Energie 186 kJ / 44 kcal - Vetten 0,8 g, waarvan verzadigdo veüuren sporen Koolhydraten 5,4 g, waarvan suikers 4,8 g - Vezels 3,0 g - 2,4 g - Zout sporen. BEREIDINGSTIPS: Aanbevolen methodo (koelkast):verspreid de nog bevroren gegritde groenten ir een geschikte schaal afgedekt met vershoudfolie. Laat 6 uur ontdooien in d\' koelkast en gebruik vervolgens zoals gewenst Andere mgfftode (micmgoffovon): leg de gewenste hoeveelheid nog bevrorer groenten goed plat op een bord en ontdooi 3 minuten 30 à 4 minuten 30 met d\' ontdooistand (160W) in de microgolfoven. Gebruik ze zoals u het wenst Andcre mgütode (oven): verwarm uw oven voor op 2000C (Th 77). Versprejo d, nog bevroren gegrilde groenten op een bakplaat bekleed mm bakpapier. Laai gedurende 7 à 8 minuten ontdooien in de oven (8 à 10 minuten een traditionele oven). Gebruik ze zoals u het wenst Pas de aanbevolcn bereidingstijdon aan ftaargolang Eogkeatoestgllea. TIP VAN DE CHEF: snij de groenten in blokjes, kruid met basilicum, peper en zout Leg ze in een schaal met olijfolie, tijm, rozemarijn en geplette knoflookteentjgs, Laat ze 4 à 5 uur marineren en serveer als aperiüefhapjes of PENSEZ TRI', '', '0.8', '0', '5.4', '4.8', '3', '2.4', '1', '0.393700787401575', '', '1');

